import React, { PureComponent } from 'react';
import PropTypes from 'prop-types';

class Text extends PureComponent {
	render() {
		const { children } = this.props;
		return (
			<span>
				<div>
				{children}
				</div>
			</span>
		);
	}
}

Text.propTypes = {
	children: PropTypes.node.isRequired,
};

export default Text;
